import React from "react";
import {Navbar, NavDropdown, Nav, Image} from  "react-bootstrap";
import PaperPlane from "./paperPlane.png"
import "./navbar.css";

const Navi = (props) => {

  return(
  <Navbar className = "naviBar">
    <Navbar.Brand href="/home">
      <Image id = "brand" src = {PaperPlane}></Image>
    </Navbar.Brand>

    <Navbar.Toggle aria-controls="basic-navbar-nav" />

    <Navbar.Collapse id="basic-navbar-nav">

      <Nav className="topNav">

      <Nav.Link href="/about">LinkedIn</Nav.Link>
        <Nav.Link href="/projects">Github</Nav.Link>
        <Nav.Link href="/contact">LinkedIn</Nav.Link>
      </Nav>

    </Navbar.Collapse>
    
        <Nav.Link href="https://www.linkedin.com/in/nyleesia/">LinkedIn</Nav.Link>
        <Nav.Link href="https://github.com/Nyleesia">Github</Nav.Link>

  </Navbar>
  )
}

export default Navi;
